question:
You are tasked with creating a function that parses a simplified ocaml package setup file represented as a string. The function should return a dictionary representing the dependency graph of the package. The dependency graph should contain the package name as the key and a list of tuples as values, where each tuple contains a dependency name and its version constraint. The setup file will include a package name, version, author, and a list of install requirements in the format 'package_name>=version' or 'package_name<version'. Write a function `parse_setup_file(code_snippet: str) -> dict` that implements this functionality. For example, given the input string '
from setuptools import setup
attrs = {
    'name': 'my_package',
    'install_requires': ['requests>=2.20.0', 'flask<2.0.0']
}
setup(name=attrs['name'], install_requires=attrs['install_requires'])', the expected output should be {'my_package': [('requests', '>=2.20.0'), ('flask', '<2.0.0')]}
